import {createTheme} from '@material-ui/core/styles'
import { orange, tail } from '@material-ui/core/colors'

const theme = createTheme({
    palette: {
        primary: {
            main: orange[400]
        },
        secondary: {
            main: tail[300]
        }
    }
})
